import { makeStyles } from "@material-ui/core";

export default makeStyles({
  paddingHorizontalLess: {
    paddingLeft: 0,
    paddingRight: 0,
  },
  transparent: {
    backgroundColor: "transparent",
  },
  descPadding: {
    paddingLeft: 56
  },
});
